parameters:    aliznet_wcs.reader.orm.category.class                   :   Aliznet\WCSBundle\Reader\ORM\CategoryReader    aliznet_wcs.reader.orm.attribute.class                  :   Aliznet\WCSBundle\Reader\ORM\AttributeReader    aliznet_wcs.reader.doctrine.item.class                  :   Aliznet\WCSBundle\Reader\Doctrine\ItemReaderHelper    aliznet_wcs.reader.repository.variant_group.class       :   Aliznet\WCSBundle\Reader\Repository\VariantGroupReader    aliznet_wcs.reader.orm.attribute_values.class           :   Aliznet\WCSBundle\Reader\ORM\AttributeValuesReaderservices:    # Readers    aliznet_wcs.reader.orm.attribute:        class: %aliznet_wcs.reader.orm.attribute.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - %pim_catalog.entity.attribute.class%            - %pim_catalog.entity.locale.class%    aliznet_wcs.reader.orm.attribute_values:        class: %aliznet_wcs.reader.orm.attribute_values.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - %pim_catalog.entity.attribute_option.class%    aliznet_wcs.reader.doctrine.item:        class: %aliznet_wcs.reader.doctrine.item.class%        arguments:            - '@pim_catalog.repository.product'            - '@pim_catalog.manager.channel'            - %pim_catalog.entity.locale.class%            - '@pim_catalog.manager.completeness'            - '@pim_transform.converter.metric'            - '@pim_catalog.object_manager.product'    aliznet_wcs.reader.repository.variant_group:        class: %aliznet_wcs.reader.repository.variant_group.class%        arguments:            - '@pim_catalog.repository.group'    aliznet_wcs.reader.orm.category:        class: %aliznet_wcs.reader.orm.category.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - '@pim_catalog.repository.category'            - %pim_catalog.entity.locale.class%